'''
Given two strings s and t, return true if s is a subsequence of t, or false otherwise.

A subsequence of a string is a new string that is formed from the original string by deleting some (can be none) of the characters without disturbing the relative positions of the remaining characters. (i.e., "ace" is a subsequence of "abcde" while "aec" is not).

Example 1:

Input: s = "abc", t = "ahbgdc"
Output: true
Example 2:

Input: s = "axc", t = "ahbgdc"
Output: false
'''
class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        slist = []
        tlist = []
        pointer_s = 0
        pointer_t = 0
        n = 0
        last_node = None
             
        for a in s:
            slist.append(a)
        
        for b in t:
            if b in slist: #filters out all the non-relevant characters from t
                tlist.append(b)
        
        print('s is', slist)
        print('t is', tlist)
        
        if len(tlist) < len(slist):  #if t is shorter than s, it is definitely false
            print('length of tlist is less than length of slist')
            return False
            
        for b in tlist: #we run through the whole list of t once, using 2 pointers in each loop to check for similarity
            pointer_t +=1
            print('t', b, pointer_t)
            for a in slist[n:]: #n is to remember where we left off in list s, in case we find a starting match
                if b == a:
                    last_node = b #this remembers the last checked word in s list, in case needed in the next iteration
                    pointer_s +=1
                    print('s', a, pointer_s)
                    n +=1 #
                    break
                elif b == last_node: #since leetcode vs leeeetcode is acceptable, we set the programme to check if there is a repeat of the last node, if yes, then we skip that node
                    
                    pointer_t -=1  #we need to reduce the pointer for t that was added, to avoid extra counts
                    print('skipped', b)
                    break
                else:
                    #the moment the sequence in list s is broken, we reset all pointers and continue iterating again in t list
                    pointer_t = 0
                    pointer_s = 0
                    n = 0

        print('pointer s is', pointer_s)
        print('pointer t is', pointer_t)
            
        if pointer_s == pointer_t:
            return True
        else:
            return False

test1 = Solution()
print(test1.isSubsequence("abc", "ahbgdc"))     
        
test2 = Solution()
print(test2.isSubsequence("axc", "ahbgdc"))

test3 = Solution()
print(test3.isSubsequence("leeeeetcode", "" ))

test4 = Solution()
print(test4.isSubsequence("rjufvjafbxnbgriwgokdgqdqewn", ""))